using System;\nusing System.Collections.Concurrent;\n\nclass Program\n{\n    static void Main()\n    {\n        // Example of ConcurrentStack\n        var stack = new ConcurrentStack<string>();\n        stack.Push("one");\n        stack.Push("two");\n        \n        string result;\n        if (stack.TryPop(out result))\n            Console.WriteLine($"Popped from stack: {result}");\n\n        // Example of ConcurrentQueue\n        var queue = new ConcurrentQueue<string>();\n        queue.Enqueue("item1");\n        queue.Enqueue("item2");\n\n        if (queue.TryDequeue(out result))\n            Console.WriteLine($"Dequeued from queue: {result}");\n    }\n}